'MET', or 'N-methyl-N-ethyltryptamine' is a hallucinogenic tryptamine. It is
closely related to DMT and DET.

There is very little information on the human pharmacology or toxicity of MET.
The freebase is believed to be active via vaporization at 15
mg [http://www.erowid.org/experiences/exp_info7.shtml "That's okay, you're
good" MET trip report] - The Vaults of Erowid and orally at 80-100 mg.
